%[text] # Run Anaerobic Digestor for substrate jump Control Study
clear
clc
activado=1;
%[text] Load Parameters
AnaerobicDigestorParameters
%[text] Simulation time
tspan=10;
%[text] Flow rate
F1=1;
F2=F1;
%[text] Initial input substrate
sif1=167; % mmol/L
%[text] Set of substrate jumps
sifjumpsbis=[27 40 40];
sifjumps=sifjumpsbis*1e3/60; % mmol/L
n=length(sifjumps);
%%
%[text] ## Running
% Inicialization to store value of simulations
tiempos = cell(1, n);
s = cell(1, n);
P_CO2=cell(1, n);
Q_CH4=cell(1, n);
pH=cell(1, n);

for i=1:n
    if i==n
        activado=0;
        tspan=3.2;
    end
    sif2=sifjumps(i);
    simout=sim('AD_model.slx');
    tiempos{i}=simout.tout;
    s{i}=simout.yout{1}.Values.Data;
    P_CO2{i}=simout.yout{2}.Values.Data;
    Q_CH4{i}=simout.yout{3}.Values.Data; % Store methane production data
    pH{i}=simout.yout{4}.Values.Data;
    subplot(2,2,1) %[output:795e22f9]
    plot(tiempos{i},s{i})
    if i==1
        hold on
        xlabel('Time, days')
        ylabel('Substrate mM as acetic acid')
    elseif i==n
        ylim([0 40])
    end
    subplot(2,2,2)
    plot(tiempos{i},P_CO2{i})
    if i==1
        hold on
        xlabel('Time, days')
        ylabel('CO_2 Partial Pressure, torr')
    elseif i==n
        ylim([100 450])
    end
    subplot(2,2,3)
    plot(tiempos{i},Q_CH4{i})
    if i==1
        hold on
        xlabel('Time, days')
        ylabel('CH_4 Production Rate L/day')
    elseif i==n
        ylim([0 22])
    end
    subplot(2,2,4)
    plot(tiempos{i},pH{i})
    if i==1
        xlabel('Time, days')
        ylabel('pH')
        hold on
    elseif i==n
        ylim([6.5 7.1])
        yline(pHoff,':')
        yline(pHth1,'--')
        yline(pHth2,'-.')
        Leyenda=cellstr(num2str(sifjumpsbis'));
        Leyenda{3}=[Leyenda{3} ' no control'];
        Leyenda{4}='pH Control Off';
        Leyenda{5}='pH threshold 1';
        Leyenda{6}='pH threshold 2';
        legend(Leyenda)
    end
end

%[text] Expand figure
fig=gcf;
fig.Position(3:4)=2*fig.Position(3:4); %[output:795e22f9]
%[text] Restore simulation time to 10 days
tspan=10;

